import { useEffect, useState } from 'react';
import api from '../api/api';

function AppointmentForm() {
  const [customers, setCustomers] = useState([]);
  const [services, setServices] = useState([]);
  const [formData, setFormData] = useState({
    customerId: '',
    serviceId: '',
    agreedPrice: '',
    paidAmount: '',
    totalSessions: 1,
    remainingSessions: 1,
    paymentMethod: 'Nakit',
    installmentCount: 0,
    appointmentDate: '',
    nextAppointmentDate: '',
    status: 'Geldi',
  });

  useEffect(() => {
    const fetchData = async () => {
      const customersRes = await api.get('/customers');
      const servicesRes = await api.get('/services');
      setCustomers(customersRes.data);
      setServices(servicesRes.data);
    };
    fetchData();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post('/appointments', {
        ...formData,
        agreedPrice: parseFloat(formData.agreedPrice),
        paidAmount: parseFloat(formData.paidAmount),
        totalSessions: parseInt(formData.totalSessions),
        remainingSessions: parseInt(formData.remainingSessions),
        installmentCount: parseInt(formData.installmentCount),
        customerId: parseInt(formData.customerId),
        serviceId: parseInt(formData.serviceId),
      });
      alert('Randevu eklendi');
    } catch (err) {
      console.error(err);
      alert('Hata oluÅŸtu');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Randevu Ekle</h2>

      <select name='customerId' onChange={handleChange} required>
        <option value=''>MÃ¼ÅŸteri SeÃ§</option>
        {customers.map((c) => (
          <option key={c.customerId} value={c.customerId}>
            {c.fullName}
          </option>
        ))}
      </select>

      <select name='serviceId' onChange={handleChange} required>
        <option value=''>Hizmet SeÃ§</option>
        {services.map((s) => (
          <option key={s.serviceId} value={s.serviceId}>
            {s.serviceName}
          </option>
        ))}
      </select>

      <input
        name='agreedPrice'
        type='number'
        placeholder='AnlaÅŸÄ±lan Ãœcret'
        onChange={handleChange}
        required
      />
      <input
        name='paidAmount'
        type='number'
        placeholder='Ã–denen Ãœcret'
        onChange={handleChange}
        required
      />
      <input
        name='totalSessions'
        type='number'
        placeholder='Toplam Seans'
        onChange={handleChange}
      />
      <input
        name='remainingSessions'
        type='number'
        placeholder='Kalan Seans'
        onChange={handleChange}
      />
      <select name='paymentMethod' onChange={handleChange}>
        <option value='Nakit'>Nakit</option>
        <option value='POS'>POS</option>
      </select>
      <input
        name='installmentCount'
        type='number'
        placeholder='Taksit SayÄ±sÄ±'
        onChange={handleChange}
      />
      <input name='appointmentDate' type='date' onChange={handleChange} />
      <input name='nextAppointmentDate' type='date' onChange={handleChange} />
      <select name='status' onChange={handleChange}>
        <option value='Geldi'>Geldi</option>
        <option value='Gelmedi'>Gelmedi</option>
        <option value='Ä°ptal'>Ä°ptal</option>
      </select>

      <button type='submit'>Kaydet</button>
    </form>
  );
}

export default AppointmentForm;
